import React from 'react';

const ImageList = (props) => {
    const images = props.images.map((images)=>{
        return <div><img alt={images.description} key={images.id} src={images.urls.regular}></img></div>
    })
    return(
        <div>{images}</div>
    )
}

export default ImageList;
